    /**
     * 上传图片
     */
    public function uploadImg($data)
    {

        $data = $data['AlarmInfoPlate'];
        $facility = $data['nParkID'] ? $data['nParkID'] : $data['ParkID'];
        $imageFile = $data['result']['PlateResult']['imageFile'];
        $recotime = str_replace(array(" ", "-", ":"), array("", "", ""), $data['result']['PlateResult']['recotime']);//识别时间
        $path = UPLOAD_PATH.'/washCar/' . $facility;

        if (!is_dir($path)) {
            mkdir($path, 0777);
        }

        $row = base64_decode($imageFile);
        $file = $path . '/' . $recotime.rand(111,999) . "_" . '.jpg';
        $rel = fopen($file, 'a+');
        fwrite($rel, $row);
        fclose($rel);
        return $file;
    }

